package java_programs;

public class Operators_relationship {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//Relational operators
		
     int a=10;
     int b=20;
     
     System.out.println(a<b);
	 System.out.println(a>b);
	 System.out.println(a==b);
	 System.out.println(a!=b);
	 System.out.println(a<=b);
	 System.out.println(a>=b);
	}

}
